    projectId: "vibez-2120e",
    storageBucket: "vibez-2120e.appspot.com",
    messagingSenderId: "902893329566",
    appId: "1:902893329566:web:7e9484bd398275a603af8f",
    measurementId: "G-846YPSLLY3"
  };

// Initialize Firebase
